import React from "react";

const Interest = () => {

return(
    <>

<div className="container">
    <div className="row text-white text-capitalize">
        <h1 className="text-center">Are You a Painter ?</h1>
        <p className="text-center">Get on board with us</p>
        <ul>
            <li className="text-center">Increase your reach</li>
            <li className="text-center">Organise your system</li>
            <li className="text-center">Strenthen your online reputation</li>
            <button className="btn btn-primary text-center">Join now</button>
        </ul>
            
        </div>

</div>

    </>
);
};
export default Interest;
